import { trigger } from 'decorators'

const { c_fault } = org.objects
const nativeFaultMap = { kInvalidArgument: 'invalidArgument',
  kValidationError: 'validation',
  kAccessDenied: 'accessDenied',
  kNotFound: 'notFound',
  kTimeout: 'timeout',
  kExists: 'exists',
  kExpired: 'expired',
  kRequestTooLarge: 'tooLarge',
  kThrottled: 'throttled',
  kTooBusy: 'tooBusy',
  kError: 'error',
  kNotImplemented: 'notImplemented',
  kUnsupportedOperation: 'unsupportedOperation'
}

class FaultLibrary {

  static throw(c_error_code, config = {}) {
    const faultCursor = c_fault.find({ c_error_code })
      .skipAcl()
      .grant(consts.accessLevels.read)

    const fault = faultCursor.hasNext() && faultCursor.next()

    // currently only path is supported
    const { path } = config

    if (fault) {
      throw Fault.create({ errCode: fault.c_error_code, reason: fault.c_reason, path })
    } else if (c_error_code.startsWith('cortex.')) {
      throw Fault.create({ errCode: c_error_code, path })
    }

    throw Fault.create('kError', { reason: 'Unknown Error' })
  }

  static getErrorCode(obj) {
    const nativeCode = nativeFaultMap[obj.c_native_code] || 'error'
    return `${obj.c_namespace}.${nativeCode}.${obj.c_detail_code}`
  }

  @trigger('create.before', { object: 'c_fault', weight: 1 })
  static faultBeforeCreate() {
    if (!script.arguments.new.c_error_code) {
      const c_error_code = FaultLibrary.getErrorCode(script.arguments.new)
      script.arguments.new.update({ c_error_code })
    }
  }

  @trigger('update.before', { object: 'c_fault', weight: 1 })
  static faultBeforeUpdate() {
    // If err_code isn't set on creation then is it set
    if (!script.arguments.new.c_error_code) {
      const obj = Object.assign(script.arguments.old, script.arguments.new)
      const c_error_code = FaultLibrary.getErrorCode(obj)
      script.arguments.new.update({ c_error_code })
    }
  }

}

module.exports = FaultLibrary

/**
 * @fileOverview
 * @summary Data Transfer Library
 * @version 1.0.0
 *
 * @author Admin Tool Squad
 *
 * @example
 * const { DataTransferLib, DataTransferFormats, DTConfig, DTExport } = require('dt__library')
 */
const { trigger, object, job, as, expressions: { expression, pipeline } } = require('decorators'),
      { merge, isPlainObject, flatten, uniq, uniqBy } = require('lodash'),
      config = require('config'),
      semver = require('semver'),
      logger = require('logger'),
      cache = require('cache'),
      faults = require('c_fault_lib'),
      moment = require('moment.timezone'),
      CACHE_TIME = 86400

/**
 * Class to manipulate formats and presets
 */
class DataTransferFormats {

  static AXON_VERSION = "4.16.0"

  /**
   * Preset list of data
   * @type {{date: string[], timezones: *, time: string[]}}
   */
  static presets = {
    date: [
      'None',
      'YYYY-MM-DD',
      'MM/DD/YYYY',
      'DD/MM/YYYY',
      'DD, MMM YYYY',
      'MMM, DD YYYY'
    ],
    time: ['None', 'HH:mm', 'HH:mm:ss', 'HH:mm:ss.SSS'],
    timezones: moment.tz.names()
  }

  /**
   * List of available formats
   */
  static formats = [
    {
      name: 'datetime',
      params: {
        tz: 'PATIENT',
      },
      as: 'array',
      operator: '$moment'
    },
    {
      name: 'date',
      params: {
        tz: 'PATIENT',
        format: 'YYYY-MM-DD'
      },
      as: 'array',
      operator: '$moment'
    },
    {
      name: 'time',
      params: {
        tz: 'PATIENT',
        format: 'HH:mm:ss'
      },
      as: 'array',
      operator: '$moment'
    },
    {
      name: 'trim',
      params: { chars: ' ' },
      as: 'object',
      operator: '$trim'
    },
    {
      name: 'trunc',
      params: { places: 0 },
      as: 'array',
      operator: '$trunc'
    },
    {
      name: 'toUpper',
      operator: '$toUpper'
    },
    {
      name: 'toLower',
      operator: '$toLower'
    },
    {
      name: 'ceil',
      operator: '$ceil'
    },
    {
      name: 'floor',
      operator: '$floor'
    },
    {
      name: 'round',
      operator: '$round'
    }
  ]


  /**
   * Convert a format object into a expression operator.
   * @param {Object|String} input represents a field or another expression
   * @param {Object} format a format object
   * @return {Object} expression.
   */
  static buildFormatExpression(input, format, type, apps) {
    const { operator, as, name } = format
    const params = Object.assign({}, format.params)
    if (Object.keys(params).length) {
      if(name === 'datetime') {
        params.format = `${params.date || ''} ${params.time || ''}`.trim()
        delete params.date
        delete params.time
      }

      if(params.tz) {
        params.tz = DataTransferFormats.getPatientTimeZone(apps, params.tz, type)
      }
      const commands = Object.entries(params).map(([key, value]) => ({ [key]: value }))
      return { $cond: [input, { [operator]: as === 'array' ? [input, ...commands] : { input, ...commands[0] } }, ''] }
    }
    return {[operator]: [input]}
  }

  static getPatientTimeZone(apps, timezone = 'PATIENT', layout = 'long') {
    const siteApps = apps.filter(a => a.label.toLowerCase().includes('site')),
          patientApps = apps.filter(a => a.label.toLowerCase().includes('patient')),
          source = layout === 'long' ? '$$ROOT.c_task_response': '$$ROOT',
          axonVersionSupported = semver.gte(config.get('axon__version').version, DataTransferFormats.AXON_VERSION),
          exp = timezone === 'PATIENT' && axonVersionSupported ? {
            $cond: [
              {$in: [`${source}.c_client.c_client_key`, {$array: siteApps.map(s => s.key)}]},
              // use site tz or utc,
              {$ifNull:[`$$ROOT.c_site.c_tz`, 'UTC']},
              // use task response tz or utc.
              {
                $cond: [
                  {$in: [`${source}.c_client.c_client_key`, {$array: patientApps.map(s => s.key)}]},
                  {$ifNull:[`${source}.c_tz`, 'UTC']},
                  'UTC'  // any other app will be UTC
                ]
              }
            ]
          } : 'UTC'
    return exp

  }

}

/**
 * Data transfer library to hold logic for expression composition.
 */
class DataTransferLib {

  /**
   * Wrapper to create an event.
   * @memberOf Package
   * @param {String} event Name of the event.
   * @param {Object} param Parameters to attach to an event.
   * @param {Date} [start = new Date()] Date to trigger the event.
   */
  static fireEvent(event, key, param, start = new Date(), expiresAt, schedule) {
    const data = {
      type: 'script',
      key: key || `${event}_${Date.now()}`,
      event,
      principal: script.principal._id,
      param,
      start,
      ...(expiresAt ? {expiresAt} : {}),
      ...(schedule ? {schedule} : {}),
    }

    return org.objects.events.insertOne(data)
        .skipAcl()
        .grant('update')
        .bypassCreateAcl()
        .lean(false)
        .execute()

    // Work around
    // org.objects.events.updateOne({_id}, {$set: { start }}).skipAcl().grant(6).execute()
  }

  static longType = {
    'object': 'c_step_response'
  }

  static wideType = {
    'object': 'c_task_response'
  }

  static piiPhiProperties = [
    'account.email',
    'account.name',
    'account.dob',
    'account.password',
    'account.key',
    'account.mobile',
    'account.username',
    'account.c_health_data',
    'c_public_user.c_email',
    'c_public_user.c_mobile',
    'c_public_user.c_participant_name_or_email',
    'c_health_datum',
    'ec__document_invite.c_email',
    'ec__signed_document.ec__final_document',
    'ec__signed_document.ec__signature_invites'
  ]

  static excludedStepTypes = ['form', 'review', 'section', 'document_section', 'instruction']

  static getStandardLabelMapping = (field) => {
    const type = 'QS', // it could be VS, needs to define when is VS
          mapping = {
            'c_study.c_name': 'STUDYID',
            'c_site.c_name': 'SITENAM',
            'c_site.c_number': 'SITEID',
            'c_public_user.c_number': 'SUBJID',
            'c_task.c_name': `${type}CAT`,
            'c_task_response.c_start': `${type}DTC`,
            'c_task_response.c_end': `${type}ENDTC`,
            'c_step.c_name': `${type}TEST`,
            'c_step_response.c_value': `${type}RESULT`
          }
    return mapping[field]
  }

  validateMinimumInput(data) {
    const { dt__study_id, dt__task_ids, dt__step_ids, dt__step_types } = data
    if (!dt__study_id || !dt__task_ids || !dt__step_ids) {
      throw faults.throw('dt.invalidArgument.missingRequiredParameters')
    }

    if(!dt__step_types || !Array.isArray(dt__step_types) || dt__step_types.length < 1) {
      throw faults.throw('dt.invalidArgument.missingRequiredParameters')
    }
  }

  /**
   * Returns the proper filtering based on type selection
   * @param {String} type long or wide
   * @param {Object} args parameters { studyId, taskIds, stepIds }
   * @return {Object} where filtering
   */
  getOptionsByType(type, args) {
    const { dt__study_id, dt__task_ids, dt__step_ids } = args,
          baseWhere = {
            ...DataTransferLib.wideType,
            where: {
              'c_study._id': dt__study_id,
              'c_task._id': Array.isArray(dt__task_ids) ? { $in: dt__task_ids } : dt__task_ids
            }
          }
    let result = baseWhere
    if (type === 'long') {
      result = merge(baseWhere, DataTransferLib.longType, {
        where: {
          'c_step._id': Array.isArray(dt__step_ids) ? { $in: dt__step_ids } : dt__step_ids
        }
      })
    }
    return result
  }

  /**
   * Gets a $cursor stage
   * @param {Object} params { studyId, taskIds, stepIds }
   * @param {String} [type=long] long or wide
   * @param {Number|Boolean} [limit=false] limit the result of the cursor stage.
   * @return {Object} $cursor stage.
   */
  getCursor(params, type = 'long', limit = false) {
    return {
      $cursor: {
        ...this.getOptionsByType(type, params),
        'operation': 'cursor',
        'sort': {
          'c_public_user._id': 1
        },
        'skipAcl': true,
        'locale': 'en_US',
        grant: 4,
        limit
      }
    }
  }

  getSchemaDateProperties() {
    let result = cache.get('dt__schemaDates')
    if(!result) {
      const objects = ['c_study', 'c_task_response', 'c_step_response', 'c_public_user', 'c_step', 'c_task', 'c_site'],
            paths = org.objects.objects.aggregate([
            {$match: {name: {$in: objects}}},
            {
              $project: {
                name: 1,
                'properties.name': 1,
                'properties.type': 1,
                'properties.properties.name': 1,
                'properties.properties.type': 1,
                'objectTypes.properties.name': 1,
                'objectTypes.properties.type': 1
              }
            }
          ]).skipAcl().grant(8).toArray()
      result = paths.reduce((obj, item) => {
        if (!Array.isArray(obj.data)) {
          obj.data = []
        }

        const filteredProps = [...item.properties, ...flatten(item.objectTypes.map(o => o.properties))].filter(p => ['Date'].indexOf(p.type) > -1),
            buildPaths = (names, parent = null) => {
              return names.map(n => {
                if (n.properties) {
                  return buildPaths(n.properties, n.name)
                }
                return parent ? `${parent}.${n.name}` : n.name
              })
            },
            values = uniq(flatten(buildPaths(filteredProps).filter(p => objects.indexOf(p) < 0)))
        if (values.length > 0) {
          values.forEach(v => obj.data.push(`${item.name}.${v}`))
        }
        return obj
      }, {})
      cache.set('dt__schemaDates', result, CACHE_TIME)
    }
    return result.data
  }

  /**
   * Will return a flattened property paths over the objects 'c_study', 'c_task_response', 'c_step_response', 'c_public_user', 'c_step', 'c_task'
   * Reference and List are going to be excluded from the paths.
   * @return {Array} return an array of objects with its all property paths
   */
  getSchemaProperties() {
    // get paths from objects
    let result = cache.get('dt__schemaProps')
    if (!result) {
      const objects = ['c_study', 'c_task_response', 'c_step_response', 'c_public_user', 'c_step', 'c_task', 'c_site'],
          paths = org.objects.objects.aggregate([
            {$match: {name: {$in: objects}}},
            {
              $project: {
                name: 1,
                label: 1,
                'properties.name': 1,
                'properties.label': 1,
                'properties.type': 1,
                'properties.properties.name': 1,
                'properties.properties.label': 1,
                'properties.properties.type': 1,
                'objectTypes.properties.name': 1,
                'objectTypes.properties.label': 1,
                'objectTypes.properties.type': 1
              }
            }
          ]).locale('en_US').skipAcl().grant(8)
      result = paths.reduce((obj, item) => {
        const filteredProps = [...item.properties, ...flatten(item.objectTypes.map(o => o.properties))].filter(p => ['Reference', 'List', 'File'].indexOf(p.type) < 0),
            buildPaths = (names, parent = null) => {
              return names.map(n => {
                if (n.properties) {
                  return buildPaths(n.properties, n)
                }
                return parent ? {type: n.type, field: `${parent.name}.${n.name}`, label: `${item.label} - ${parent.label} - ${n.label}`} : {type: n.type, field: n.name, label: `${item.label} - ${n.label}`}
              })
            }
        obj[item.name] = uniqBy(flatten(buildPaths(filteredProps).filter(p => objects.indexOf(p) < 0)).filter(p => ['Reference', 'List', 'File'].indexOf(p.type) < 0), 'field')
        return obj
      }, {})
      cache.set('dt__schemaProps', result, CACHE_TIME)
    }
    return result
  }

  /**
   * Will return a transform stage to expand c_public_user and c_task_response depending on layout type
   * @param {String} type long or wide
   * @return {Object} $transform stage.
   */
  getFilterExpansions(type) {
    const props = this.getSchemaProperties()
    return {
      $transform: {
        vars: {
          publicUser: null,
          ...(type === 'long' ? { taskResponse: null} : {})
        },
        each: {
          set: {
            publicUser: {
              $dbNext: [
                {
                  $object: {
                    object: 'c_public_user',
                    skipAcl: true,
                    grant: 4,
                    where: { _id: '$$ROOT.c_public_user._id' },
                    ...(props.c_public_user ? {paths: { $literal: props.c_public_user.map(p => p.field) }} : {})
                  }
                },
                60
              ]
            },
            ...(type === 'long' ? {
              taskResponse: {
                $dbNext: [
                  {
                    $object: {
                      object: 'c_task_response',
                      skipAcl: true,
                      grant: 4,
                      where: { _id: '$$ROOT.c_task_response._id' },
                      ...(props.c_task_response ? {paths: { $literal: props.c_task_response.map(p => p.field) }} : {})
                    }
                  },
                  60
                ]
              }
            } : {})
          },
          in: {
            $mergeObjects: [
              '$$ROOT',
              {
                $object: {
                  c_public_user: '$$publicUser',
                  ...(type === 'long' ? {
                    c_task_response: '$$taskResponse'
                  } : {})
                }
              }
            ]
          }
        }
      }
    }
  }

  /**
   * Will return extra expansions
   * @param {String} type long or wide
   * @return {Object} $transform stage.
   */
  getExtraExpansions(type = 'long') {
    const props = this.getSchemaProperties()
    return {
      $transform: {
        vars: {
          task: null,
          study: null,
          site: null,
          ...(type === 'long' ? { step: null} : {})
        },
        each: {
          set: {
            task: {
              $dbNext: [
                {
                  $object: {
                    object: 'c_task',
                    skipAcl: true,
                    grant: 4,
                    where: { _id: '$$ROOT.c_task._id' },
                    ...(props.c_task ? {paths: { $literal: props.c_task.map(p => p.field) }} : {})
                  }
                },
                60
              ]
            },
            study: {
              $dbNext: [
                {
                  $object: {
                    object: 'c_study',
                    skipAcl: true,
                    grant: 4,
                    where: { _id: '$$ROOT.c_study._id' },
                    ...(props.c_study ? {paths: { $literal: props.c_study.map(p => p.field) }} : {})
                  }
                },
                60
              ]
            },
            site: {
              $dbNext: [
                {
                  $object: {
                    object: 'c_site',
                    skipAcl: true,
                    grant: 4,
                    where: { _id: '$$ROOT.c_site._id' },
                    ...(props.c_site ? {paths: { $literal: props.c_site.map(p => p.field) }} : {})
                  }
                },
                60
              ]
            },
            ...(type === 'long' ? {
              step: {
                $dbNext: [
                  {
                    $object: {
                      object: 'c_step',
                      skipAcl: true,
                      grant: 4,
                      where: { _id: '$$ROOT.c_step._id' },
                      ...(props.c_step ? {paths: { $literal: props.c_step.map(p => p.field) }} : {})
                    }
                  },
                  60
                ]
              }
            } : {})
          },
          in: {
            $mergeObjects: [
              '$$ROOT',
              {
                $object: {
                  c_task: '$$task',
                  c_study: '$$study',
                  c_site: '$$site',
                  ...(type === 'long' ? {
                    c_step: '$$step'
                  } : {})
                }
              }
            ]
          }
        }
      }
    }
  }

  getMatch(type = 'long') {
    return {
      $match: {
        ...(type === 'long' ? {
          $and: [
            { $ifNull: ['$$ROOT.c_public_user.c_number', false] },
            { $eq: ['$$ROOT.c_task_response.c_completed', true] }
          ]
        } : { $ifNull: ['$$ROOT.c_public_user.c_number', false] })
      }
    }
  }

  getIndexing(apps, type= 'long', tzFrom = 'PATIENT') {
    return {
      $transform: {
        vars: {
          line: null
        },
        each: {
          set: {
            line: {
              $dbNext: [{
                $object: {
                  "object": type === 'long' ? "c_step_response" : 'c_task_response',
                  "pipeline": {
                    $array: [
                      {
                        $object: {
                          "$match": {
                            "c_public_user._id": "$$ROOT.c_public_user._id",
                            "c_task._id": "$$ROOT.c_task._id",
                            ...(type === 'long' ? {"c_step._id": "$$ROOT.c_step._id"} : {})
                          }
                        }
                      },
                      {
                        $object: {
                          "$group": {
                            "_id": {
                              "c_day": {
                                $object: {
                                  "$dateToString": {
                                    $array: [
                                      "%d/%m/%G",
                                      type === 'long' ? "c_end_date" : 'c_end',
                                      (DataTransferFormats.getPatientTimeZone(apps, tzFrom, type))
                                    ]
                                  }
                                }
                              }
                            },
                            "items": {
                              $literal: {
                                "$push": '_id'
                              }
                            }
                          }
                        }
                      }, {
                        $object: {
                          "$match": {
                            "_id.c_day": {$moment:[ type === 'long' ? '$$ROOT.c_end_date' : '$$ROOT.c_end', {tz: DataTransferFormats.getPatientTimeZone(apps, tzFrom, type)}, {'format': 'DD/MM/YYYY'}]}
                          }
                        }
                      }
                    ]
                  }
                }
              }, 60]
            }
          },
          in: { $mergeObjects: ['$$ROOT', { $object: { 'line': '$$line' } }] }
        }
      }
    }
  }

  getColumnarSteps(taskIds, stepIds = [], types = []) {
    const stepTypes = types.map(st => {
      if(st === 'autocomplete_text' || st === 'c_autocomplete_text') {
        return 'c_text'
      }
      return st.indexOf('c_') === 0 ? st : `c_${st}`
    })
    return [
      {
        $transform: {
          vars: {
            values: null
          },
          each: {
            set: {
              values: {
                $dbNext: {
                  $object: {
                    object: 'c_step_response',
                    pipeline: {
                      $array: [
                        {
                          $object: {
                            $match: {
                              'c_step._id': Array.isArray(stepIds) ? {$literal: {$in: stepIds}} : stepIds,
                              'c_task._id': Array.isArray(taskIds) ? {$literal: {$in: taskIds}} : taskIds,
                              'c_task_response._id': '$$ROOT._id',
                              'type': {$literal: {$in: stepTypes}}
                            }
                          }
                        },
                        {
                          $literal: {
                            $project: {
                              'c_value': 1,
                              'c_step': 1,
                              'type': 1
                            }
                          }
                        },
                        {
                          $literal: {
                            $group: {
                              _id: null,
                              values: { '$push': {id: 'c_step', value: 'c_value', type: 'type'} }
                            }
                          }
                        }
                      ]
                    }
                  }
                }
              }
            },
            in: {
              $mergeObjects: ['$$ROOT', { $object: { 'steps': {$ifNull: ['$$values.values', {$literal: []}] } }}]
            }
          }

        }
      }
    ]
  }

  _parseLiteralOrField(source) {
    let result
    const { literal, field } = source

    if (literal) {
      result = {
        $literal: literal
      }
    } else if (field) {
      const isPII = DataTransferLib.piiPhiProperties.find(p => field.includes(p))
      if(isPII) {
        result = null
      } else {
        if(field.indexOf('c_step_response.c_value') > -1) {
          result = {$cond: ['$$ROOT.c_step.c_personal_data', '', `$$ROOT.${field}`]}
        } else {
          result = `$$ROOT.${field}`
        }
      }
    }

    return result
  }

  _parseComposition(composition) {
    const { values, operator } = composition

    return {
      [operator]: values.map(v => this._parseLiteralOrField(v))
    }
  }

  _parseCompLiteralOrField(source) {
    let result
    const { composition } = source

    if (composition) {
      result = this._parseComposition(composition)
    } else {
      result = this._parseLiteralOrField(source)
    }

    return result
  }

  _parseConditional(m) {
    const {
      field,
      conditionals
    } = m

    return {
      $switch: {
        branches: conditionals.cases.map(cond => {
          return {
            case: { $eq: [ `$$ROOT.${field}`, cond.case ] },
            then: this._parseCompLiteralOrField(cond.value)
          }
        }),
        default: this._parseCompLiteralOrField(conditionals.default)
      }
    }
  }

  _applyFormat(inputFormat, inputData, type, apps) {
    const { name } = inputFormat,
          format = DataTransferFormats.formats.find(f => f.name === name)

    if (format) {
      return DataTransferFormats.buildFormatExpression(inputData, merge(format, inputFormat), type, apps)
    } else {
      faults.throw('dt.invalidArgument.invalidFormat')
    }
  }

  _getProjectionItem(type, mapping, apps, dt__timezoneFrom = 'UTC') {
    let result

    const {
      field,
      composition,
      format,
      conditionals
    } = mapping

    if (conditionals && field) {
      // We're not allowing compositions or literals to have conditionals.
      result = this._parseConditional(mapping)
    } else if (composition) {
      result = this._parseComposition(composition)
    } else {
      result = this._parseLiteralOrField(mapping)
    }

    let formatOverrides = false
    if (format) {
      if(['date', 'time', 'datetime'].indexOf(format.name) > - 1) {
        formatOverrides = true
      }
      result = this._applyFormat(format, result, type, apps)
    }

    if (field) {
      const baseField = type === 'long' ? 'c_step_response' : 'c_task_response',
          mappedDates = this.getSchemaDateProperties(),
          fieldToCheck = field.indexOf(baseField) > -1 ? field : `${baseField}.${field}`

      if ((mappedDates.includes(field) || mappedDates.includes(fieldToCheck)) && !formatOverrides) {
        const tz = DataTransferFormats.getPatientTimeZone(apps, dt__timezoneFrom, type)
        if(field.indexOf('c_step_response.c_value') > -1 || fieldToCheck.indexOf('c_step_response.c_value') > -1) {
          result = {$cond: [{ $in: [ '$$ROOT.type', { $array: [ 'c_date', 'c_datetime' ] } ] }, {$moment: [result, {tz}, {format: ''}]}, result] }
        } else {
          result = {$cond: [result, {$moment: [result, {tz}, {format: ''}]}, null]}
        }
      }
    }

    return result
  }

  transformMappingToExpression(mapping, stepIds, type, apps, includeLine = true, dt__timezoneFrom = 'UTC') {

    let isDefault = false
    if(mapping.length === 0) {
      isDefault = true
      mapping = this.buildDefaultMapping(type)
    } else if(mapping.length > 0 && type === 'long') {
      mapping = mapping.filter(m => !m.autogenerated)
    }

    if (type === 'wide' && isDefault) {
      const steps = org.objects.c_steps.find({_id: {$in: Array.isArray(stepIds) ? stepIds : [stepIds]}}).sort({c_order: 1}).paths('_id', 'c_mappings', 'c_name').skipAcl().grant(4).toArray()
      mapping = mapping.concat(steps.map((s, k) => ({
        label: s.c_mappings ? s.c_mappings.c_cdash || s.c_name : s.c_name,
        autogenerated: true,
        expression: {
            $cond: [
              {
                $eq: [{
                  $pathTo: [{
                    $find: {
                      input: '$$ROOT.steps',
                      as: 's',
                      cond: {
                        $eq: [{$pathTo: ['$$s', 'id._id']}, {$toObjectId: s._id}]
                      }
                    }
                  }, 'type']
                }, 'c_datetime']
              },
              {
                $moment: [
                  {$pathTo: [{
                      $find: {
                        input: '$$ROOT.steps',
                        as: 's',
                        cond: {
                          $eq: [{$pathTo: ['$$s', 'id._id']}, {$toObjectId: s._id}]
                        }
                      }
                    }, 'value']},
                  {tz: (DataTransferFormats.getPatientTimeZone(apps, dt__timezoneFrom, type))},
                  {'format': ''}
                ]
              },
              {$pathTo: [{
                  $find: {
                    input: '$$ROOT.steps',
                    as: 's',
                    cond: {
                      $eq: [{$pathTo: ['$$s', 'id._id']}, {$toObjectId: s._id}]
                    }
                  }
                }, 'value']}
            ]
        }
      })))
    }

    if (includeLine) {
      mapping.push({
        label: 'INDEXNUMBER',
        expression: {
          $add: [
            {
             $cond: [
               {$eq:[{$indexOfArray: [{$ifNull:['$$ROOT.line.items', {$array: []}]}, '$$ROOT._id']}, -1]}, 0, {$indexOfArray: [{$ifNull:['$$ROOT.line.items', {$array: []}]}, '$$ROOT._id']}
             ]
            },
            1
          ]
        }
      })
    }

    const project = mapping.map(m => {
      let field = m.field
      if (field && type === 'wide') {
        field = field.indexOf('c_task_response') === 0 ? field.replace('c_task_response.', '') : field
      } else if(field && type === 'long') {
        field = field.indexOf('c_step_response') === 0 ? field.replace('c_step_response.', '') : field
      }

      return {
        label: m.label,
        expression: m.expression || this._getProjectionItem(type, { ...m, field }, apps, dt__timezoneFrom),
        other: m.other
      } 
    }).reduce((acc, value) => {
      const { label, expression } = value
      acc[label] = expression

      return acc
    }, {})

    if (isPlainObject(project) && Object.keys(project).length > 0) {
      // Adding extraction date.
      project['Extraction_Date'] = '$$DATE'

      return {
        projectExp: { $project: project },
        mappedData: mapping
      }
    }

    return { mappedData: mapping }
  }

  getFullExpression(params, limit = false) {
    const {
      dt__task_ids,
      dt__step_ids,
      dt__step_types = ['c_text_choice'], 
      dt__timezoneFrom = 'PATIENT', 
      dt__mapping = [], 
      dt__type: type = 'long' 
    } = params,
    apps = org.read('apps.clients') .map(c => ({key: c[0].key, label: c[0].label})),
    { projectExp, mappedData } = this.transformMappingToExpression(dt__mapping, dt__step_ids, type, apps, params.dt__includeIndexing, dt__timezoneFrom),
    expr = [
      this.getCursor(params, type, limit),
      this.getFilterExpansions(type),
      // this.getMatch(type),: bring all data according DS team. comment in case change of mind.
      this.getExtraExpansions(type),
      ...(params.dt__includeIndexing ? [this.getIndexing(apps, type, dt__timezoneFrom)] : []),
      ...(type === 'wide' ? this.getColumnarSteps(dt__task_ids, dt__step_ids, dt__step_types) : []),
      projectExp
    ].filter(entry => entry)
    return { expr, mapping: mappedData }
  }

  getFields(type= 'long') {
    const props = this.getSchemaProperties(),
        result = [
          ...(type === 'long' ?
                  [
                    ...props.c_step_response.map(p => ({field: `c_step_response.${p.field}`, label: p.label, type: p.type})),
                    ...props.c_task_response.map(p => ({field: `c_task_response.${p.field}`, label: p.label, type: p.type})),
                    ...props.c_step.map(p => ({field: `c_step.${p.field}`, label: p.label, type: p.type}))
                  ] : props.c_task_response.map(p => ({field: `c_task_response.${p.field}`, label: p.label, type: p.type}))
          ),
          ...props.c_study.map(p => ({field: `c_study.${p.field}`, label: p.label, type: p.type})),
          ...props.c_public_user.map(p => ({field: `c_public_user.${p.field}`, label: p.label, type: p.type})),
          ...props.c_task.map(p => ({field: `c_task.${p.field}`, label: p.label, type: p.type})),
          ...props.c_site.map(p => ({field: `c_site.${p.field}`, label: p.label, type: p.type}))
        ],
        filteredResult = flatten(result).filter(r => DataTransferLib.piiPhiProperties.indexOf(r.field) < 0)
            .map(f => {
              return {
                ...f,
                label: DataTransferLib.getStandardLabelMapping(f.field) || f.label
              }
            })
    return filteredResult
  }

  buildDefaultMapping(type = 'long') {
    const fields = this.getFields(type),
          items = type === 'long'
              ? ['c_study.c_name', 'c_site.c_name', 'c_site.c_number', 'c_public_user.c_number', 'c_task.c_name', 'c_task_response.c_start', 'c_task_response.c_end', 'c_step.c_name', 'c_step_response.c_value']
              : ['c_study.c_name', 'c_site.c_name', 'c_site.c_number', 'c_public_user.c_number', 'c_task.c_name', 'c_task_response.c_start', 'c_task_response.c_end'],
          result = fields.filter(f => items.indexOf(f.field) > -1)
              .sort((a,b) => items.indexOf(a.field) - items.indexOf(b.field))

    // append computed column
    if(type === 'long') {
      result.push({
        expression: {
          $map: {
            input: '$$ROOT.c_value',
            as: 'entry',
            in: {
             $pathTo: [
               {
                 $find: {
                   input: '$$ROOT.c_step.c_text_choices',
                   as: 'choice',
                   cond: {$eq: ['$$entry', '$$choice.c_value']}
                 }
               },
               'c_text'
             ]
            }
          }
        },
        label: 'QSRESULTC'
      })
    }
    return result
  }
}

/**
 * DTConfig object
 * @extends CortexObject
 */
@object('dt__config')
class DTConfig extends CortexObject {

  static convertToCron(start, dt__repeat_value, dt__increment) {
    const hour = start.hour(),
          day = start.date(),
          minutes = start.minutes() + 1 // Hack: adding 1 minute otherwise start gets overwritten by schedule and time doesn't match
    let scheduled = ''
    switch (dt__increment) {
      case 'hours':
        scheduled = `${minutes} */${dt__repeat_value} * * *`
        break
      case 'days':
        scheduled = `${minutes} ${hour} */${dt__repeat_value} * *`
        break
      case 'weeks':
        scheduled = `${minutes} ${hour} ${day}/${dt__repeat_value * 7} * *`
        break
      case 'months':
        scheduled = `${minutes} ${hour} ${day} */${dt__repeat_value} *`
        break
    }
    return scheduled
  }

  /**
   * Named expression to validate status
   * @type {$cond: {else: boolean, then: {$cond: {else: boolean, then: boolean, if: string}}, if: {$eq: string[]}}}
   * @memberOf DTConfig
   * @return {Object} expression
   */
  @expression
  dt__config__requireValidatorStatus = {
    '$cond': {
      'if': {
        $and: [{
          '$eq': ['$$ROOT.dt__status', 'READY_TO_TRANSFER']
        }, '$$ROOT.dt__sftp_target.dt__zipped']
      },
      'then': {
        '$cond': {
          'if': '$value',
          'then': true,
          'else': false
        }
      },
      'else': true
    }
  }

  /**
   * Named expression to validate pem file
   * @type expression
   * @memberOf DTConfig
   * @return {Object} expression
   */
  @expression
  dt__config__passwordOrPem = true

  /**
   * Named expression to validate password
   * @type expression
   * @memberOf DTConfig
   * @return {Object} expression
   */
  @expression
  dt__config__pemOrPassword = true

  /**
   * After update configuration we need to see if it was configured to be scheduled
   * if so we create a scheduled event otherwise a run now event is going to be created.
   * @param {DTConfig} context The updated dt__config object.
   */
  @trigger('update.after', {
    name: 'dt__config_after_update',
    export: 'dt__config_after_update',
    object: 'dt__config',
    weight: 1
  })
  static afterUpdate({ context}) {
    const [dt__config] = org.objects.dt__config.find({_id: context._id})
    if (dt__config.dt__status === 'READY_TO_TRANSFER') {
      try {

        if (dt__config.dt__schedule.dt__active) {
          // remove previous event if there was one
          logger.debug(`About to delete all previous events for: ${dt__config.dt__key}`)
          org.objects.events.deleteMany({key: new RegExp(`^dt__${dt__config.dt__key}`)}).skipAcl().grant(8).execute()
          // set to scheduled
          org.objects.dt__config.updateOne({_id: dt__config._id}, {$set: {dt__status: 'SCHEDULED_TRANSFER'}}).grant(6).execute()

          // TODO: commented because work around for cortex event issue with start and schedule.
          // const {
          //       dt__start_date, dt__start_timezone, dt__end_date, dt__end_timezone,
          //       dt__repeat_value, dt__increment
          //     } = dt__config.dt__schedule,
          //     start = moment.tz(moment(dt__start_date).format('YYYY-MM-DD HH:mm'), dt__start_timezone).utc(),
          //     expiresAt = dt__end_date ? moment.tz(moment(dt__end_date).format('YYYY-MM-DD HH:mm'), dt__end_timezone || dt__start_timezone).utc() : undefined,
          //     schedule = dt__repeat_value && dt__increment ? DTConfig.convertToCron(start, dt__repeat_value, dt__increment) : undefined

          const { dt__start_date, dt__start_timezone } = dt__config.dt__schedule,
                start = moment.tz(moment(dt__start_date).format('YYYY-MM-DD HH:mm'), dt__start_timezone).utc(),
                evt = DataTransferLib.fireEvent('dt__event_executioner', `dt__${dt__config.dt__key}__${dt__config.updated}`, { dt__key: dt__config.dt__key }, start.toDate())
          logger.debug(evt)
          // // schedule an event based on schedule information.
          // logger.debug(`Running event dt__${dt__config.dt__key} scheduled`)
          // DataTransferLib.fireEvent('dt__event_exp_execution', `dt__${dt__config.dt__key}__${dt__config.updated}`, {
          //   dt__key: dt__config.dt__key
          // }, start.format(), expiresAt ? expiresAt.format() : undefined, schedule)
        } else {
          org.objects.dt__config.updateOne({_id: dt__config._id}, {$set: {dt__status: 'RUNNING'}}).grant(6).execute()
          logger.debug(`Running event dt__${dt__config.dt__key} once`)
          DataTransferLib.fireEvent('dt__event_exp_execution', `dt__${dt__config.dt__key}__${dt__config.updated}`, {
            dt__key: dt__config.dt__key
          })
        }
      } catch (ex) {
        logger.error(ex.toJSON())
        org.objects.dt__config.updateOne({_id: dt__config._id}, {$set: {dt__status: 'ERROR'}}).skipAcl().grant(6).execute()
      }
    }
  }

  @trigger('update.before', {
    name: 'dt__config_before_update',
    export: 'dt__config_before_update',
    object: 'dt__config',
    weight: 1
  })
  beforeUpdate({ context, old }) {

    const { dt__sftp_target: payloadTarget, dt__status: payloadStatus, dt__schedule: payloadSchedule } = context,
          { dt__sftp_target: currentTarget, dt__status: currentStatus, dt__schedule: currentSchedule } = old,
          isReady = payloadStatus === 'READY_TO_TRANSFER' || currentStatus === 'READY_TO_TRANSFER'


    if(isReady) {
      const target = merge({}, currentTarget, payloadTarget),
            schedule = merge({}, currentSchedule, payloadSchedule)
      if(target && (!target.dt__username || !target.dt__host) && (!target.dt__password && !target.dt__pem_file)) {
        faults.throw('dt.invalidArgument.requiredTargetFields')
      }

      if(schedule && schedule.dt__active && schedule.dt__start_date) {
        const start = moment.tz(moment(schedule.dt__start_date).format('YYYY-MM-DD HH:mm:ss'), schedule.dt__start_timezone || 'UTC'),
              startWithInc = start.add(schedule.dt__repeat_value || 1, schedule.dt__increment || 'hours')

        if(start.tz('UTC').isBefore(moment())) {
          faults.throw('dt.invalidArgument.invalidScheduleStartDate')
        }

        if(schedule.dt__end_date) {
          const end = moment.tz(moment(schedule.dt__end_date).format('YYYY-MM-DD HH:mm:ss'), schedule.dt__end_timezone || schedule.dt__start_timezone || 'UTC')
          if(end.isBefore(start) || end.isBefore(startWithInc)) {
            faults.throw('dt.invalidArgument.invalidScheduleDates')
          }
        }
      }



    }
  }

  @trigger('create.before', {
    name: 'dt__config_before_create',
    export: 'dt__config_before_create',
    object: 'dt__config',
    weight: 1
  })
  beforeCreate({ context }) {
    let { dt__bundle_name: bundleName } = context

    if (!bundleName) {
      const [study] = org.objects.c_study.find()

      bundleName = study.c_protocol_number
        ? `${study.c_protocol_number}`
        : `${study.c_name.replace(/\s+/g, '_')}`

      context.update('dt__bundle_name', bundleName)
    }
  }

  /**
   * Job that executes each 3 minutes to check if there is a job to process.
   */
  @job('*/30 * * * *', {
    weight: 1,
    name: 'dt__job_scheduledTransfers',
    if: {
      $ifNull: [{
          $dbNext: [
            {
              $literal: {
                object: 'dt__config',
                where: {
                  dt__status: 'SCHEDULED_TRANSFER',
                  'dt__schedule.dt__end_date': {$exists: true}
                }
              }
            }]
      }, false]
    }
  })
  @as('dt__service', { principal: { skipAcl: true, grant: 'script' }, safe: false })
  static checkScheduledTransfers() {
      const exp = [
        {
          $cursor: {
            object: 'dt__config',
            operation: 'cursor',
            where: {
              dt__status: 'SCHEDULED_TRANSFER',
              'dt__schedule.dt__end_date': {$exists: true}
            }
          }
        },
        {
          $match: {
            $gte: [{
              $moment: [new Date(), {tz: 'UTC'}]
            }, {
              $moment: [
                {
                  $moment: [
                    '$$ROOT.dt__schedule.dt__end_date',
                    {
                      format: 'YYYY-MM-DD HH:mm'
                    },
                    {
                      tz: {
                        $ifNull: ['$$ROOT.dt__schedule.dt__end_timezone', '$$ROOT.dt__schedule.dt__start_timezone']
                      }
                    }
                  ]
                },
                {
                  tz: 'UTC'
                }
              ]
            }]
          }
        },
        {$project: {_id: '$$ROOT._id', dt__key: '$$ROOT.dt__key'}}
      ],
      result = pipeline.run(exp).toArray(),
      keys = result.map(r => r.dt__key) || [],
      ids = result.map(r => r._id) || []
      if(ids.length > 0) {
        keys.forEach((key) => {
          // remove previous event if there was one
          logger.debug(`About to delete all previous events for: ${key}`)
          org.objects.events.deleteMany({key: new RegExp(`^dt__${key}`)}).skipAcl().grant(8).execute()
        })
        org.objects.dt__config.updateMany({_id: {$in: ids}}, {$set: {dt__status: 'COMPLETED'}}).skipAcl().grant(6).execute()
      }
  }
}

/**
 * DTExport object
 * @class DTExport
 */
@object('dt__export')
class DTExport extends CortexObject {

  static generateTemplate(mapping, cursorName, format = 'csv') {
    mapping = mapping || []
    // adding extraction date
    mapping.push({label: 'Extraction_Date'})
    if (format === 'csv') {

      const headers = mapping.map(m => m.label).join(','),
            fields = mapping.map(m => `{{[${m.label}]}}`).join(',')
      return `${headers}\n{{#each (cursor ${cursorName})}}${fields}\n{{/each}}`
    } else if (format === 'html' || format === 'pdf') {

      return `
        <table>
            <thead>
                ${mapping.map(m => `<th>${m.label}</th>`).join()}
            </thead>
            <tbody>
                {{#each (cursor ${cursorName})}}
                <tr>{{${mapping.map(m => `<td>{{[${m.label}]}}</td>`).join()}}}</tr>
                {{/each}}
            </tbody>
        </table>
      `
    } else if (format === 'txt') {
      const headers = mapping.map(m => m.label).join(' | '),
            fields = mapping.map(m => `{{['${m.label}']}}`).join(' | ')
      return `${headers}\n{{#each (cursor ${cursorName})}}${fields}\n{{/each}}`
    }

  }

  static generateExpression(exportItem) {
    const DTLib = new DataTransferLib(),
          { dt__study_id, dt__mapping, dt__type, dt__task_ids, dt__step_types, dt__step_ids, dt__timezoneFrom } = exportItem,
          taskIds = org.objects.c_task.find({ _id: {$in: dt__task_ids}}).skipAcl().grant(4).paths('_id').toArray().map(t => t._id),
          stepIds = org.objects.c_step.find({ _id: { $in: dt__step_ids } }).skipAcl().grant(4).paths('_id').toArray().map(t => t._id)

    if (taskIds.length === 0 || stepIds.length === 0) {
      faults.throw('dt.invalidArgument.missingTasksOrSteps')
    }
    const { expr } = DTLib.getFullExpression({
      dt__study_id,
      dt__task_ids,
      dt__step_ids,
      dt__mapping,
      dt__step_types,
      dt__timezoneFrom,
      dt__type
    })
    return expr
  }

  static regenerateProps(context, _id) {
    const [exportItem] = org.objects.dt__export.find({ _id }).skipAcl().grant(4)

    if(exportItem) {
      // update template
      const {dt__mapping: mapping, dt__filename: filename, dt__format: format} = exportItem,
          cursorName = `cursor_${(filename || '').replace(/[\W_]+/g, '')}_${format}`

      org.objects.dt__export.updateOne({_id}, {
        $set: {
          dt__cursorName: cursorName,
          dt__template: DTExport.generateTemplate(mapping, cursorName, format),
          dt__expression: DTExport.generateExpression(exportItem)
        }
      }).skipAcl().grant(6).execute()
    }
  }

  @trigger('update.after', {
    name: 'dt__export_update_after',
    export: 'dt__export_update_after',
    object: 'dt__export',
    weight: 1
  })
  @as('dt__service', { principal: { skipAcl: true, grant: 'script' }, safe: false })
  afterUpdate({ context, modified }) {
    const [exportItem] = org.objects.dt__export.find({_id: context._id}),
          [config] = org.objects.dt__config.find({_id: exportItem.dt__config._id}),
          needGeneration = !exportItem.dt__expression || !exportItem.dt__template || !exportItem.dt__cursorName,
          hasToRun = modified ? modified.filter(m => ['dt__timezoneFrom', 'dt__study_id', 'dt__step_ids', 'dt__task_ids', 'dt__mapping'].indexOf(m) > -1) : []
    if(hasToRun.length > 0 || needGeneration) {
      DTExport.regenerateProps(context, exportItem._id)
    }

    if (config && config.dt__status !== 'SCHEDULED_TRANSFER') {
      org.objects.dt__config.updateOne({ _id: config._id }, {
        $set: {
          dt__status: 'CONFIGURING'
        }
      }).execute()
    }
  }

  @trigger('create.after', {
    name: 'dt__export_after_create',
    export: 'dt__export_after_create',
    object: 'dt__export',
    weight: 1
  })
  @as('dt__service', { principal: { skipAcl: true, grant: 'script' }, safe: false })
  afterCreate({ context }) {
    const [exportItem] = org.objects.dt__export.find({_id: context._id}),
          [dt__config] = org.objects.dt__config.find({ _id: exportItem.dt__config._id })
    DTExport.regenerateProps(exportItem, exportItem._id)
    if (dt__config && dt__config.dt__status !== 'SCHEDULED_TRANSFER') {
      org.objects.dt__config.updateOne({ _id: dt__config._id }, {
        $set: {
          dt__status: 'CONFIGURING'
        }
      }).execute()
    }
  }

}

