    /**
     * Route to get a preview data list based on payload config
     * @memberOf Package
     * @path {POST} /data-transfers/preview
     * @query {Boolean} [onlyExpression=false] when true will return mapping and expression only.
     * @body {String} studyId Study Id
     * @body {Array} taskIds List of c_task._id
     * @body {Array} stepIds List of c_step._id
     * @body {String} [type=long] Data layout wide|long.
     * @body {Array} mappings list of mapping configurations.
     * @response {Object} data
     * @response {Object} [data.expr] Expression used to extract data.
     * @response {Array} data.mapping Array of mapping information.
     * @response {Array} data.list Items returned from the expression execution.
     * @example
     * curl 'https://api-int-dev.medable.com/data-transfers/v2/routes/data-transfers/preview' \
     * --data-raw '{"dt__study_id":"5f0747d6a0207f0100f453f2","dt__task_ids":["6081b3ae4a9b830100166d84"],"dt__step_ids":["6081b3ae4a9b830100166d83","6082e914e5938b01007dead4","6081af32096d7601002f3253"],"dt__type":"wide","dt__mapping":[{"literal":"DS000123124PET","label":"STUDY"},{"literal":"SGRQ IPF","label":"QSCAT"},{"literal":" -P7D","label":"QSEVLINT"},{"literal":"PAST 7 DAYS","label":"QSCEVINT"}]}'
     */
    @route('POST /data-transfers/preview', {
        name: 'dt__preview',
        acl: 'role.dt__admin',
        authValidation: 'all'
    })
    @as('dt__service', {principal: {skipAcl: true, grant: 'read'}, safe: false})
    static preview({req, body}) {
        const DTLib = new DataTransferLib(),
              payload = body()
        DTLib.validateMinimumInput(payload)
        // eslint-disable-next-line one-var
        const {expr, mapping} = DTLib.getFullExpression(payload, req.query.limit || 20)
        return req.query.onlyExpression === 'true' ? {expr, mapping} : {
            list: expressions.pipeline.run(expr).toArray(),
            mapping
        }
    }

    /**
     * Route to get a preview data list based on payload config
     * @memberOf Package
     * @path {POST} /data-transfers/preview
     * @query {Boolean} [onlyExpression=false] when true will return mapping and expression only.
     * @body {String} studyId Study Id
     * @body {Array} taskIds List of c_task._id
     * @body {Array} stepIds List of c_step._id
     * @body {String} [type=long] Data layout wide|long.
     * @body {Array} mappings list of mapping configurations.
     * @response {Object} data
     * @response {Object} [data.expr] Expression used to extract data.
     * @response {Array} data.mapping Array of mapping information.
     * @response {Array} data.list Items returned from the expression execution.
     * @example
     * curl 'https://api-int-dev.medable.com/data-transfers/v2/routes/data-transfers/preview' \
     * --data-raw '{"dt__study_id":"5f0747d6a0207f0100f453f2","dt__task_ids":["6081b3ae4a9b830100166d84"],"dt__step_ids":["6081b3ae4a9b830100166d83","6082e914e5938b01007dead4","6081af32096d7601002f3253"],"dt__type":"wide","dt__mapping":[{"literal":"DS000123124PET","label":"STUDY"},{"literal":"SGRQ IPF","label":"QSCAT"},{"literal":" -P7D","label":"QSEVLINT"},{"literal":"PAST 7 DAYS","label":"QSCEVINT"}]}'
     */
    @route('POST /data-transfers/callback', {
        name: 'dt__callback',
        acl: 'role.dt__admin',
        authValidation: 'all'
    })
    static callbackCall({body}) {
        logger.debug(`Callback from renderer: ${JSON.stringify(body())}`)
        const renderer = new Job(AXON_APP),
            data = body(),
            {executionId} = data,
            [execution] = org.objects.dt__execution.find({_id: executionId}),
            [config] = org.objects.dt__config.find({_id: execution.dt__config._id}),
            rendererData = Package.parseRendererResult(renderer.status(execution.dt__renderer_key)),
            {status, err } = rendererData

        logger.debug(rendererData)

        if (['Completed', 'Error'].indexOf(status) > -1) {
            if (status === 'Completed') {
                org.objects.dt__execution.updateOne({_id: executionId}, {
                    $set: {
                        dt__status: 'SUCCESS',
                        dt__ended: new Date()
                    }
                }).skipAcl().grant(8).execute()
                if(!config.dt__schedule.dt__active) {
                   // mark as completed
                   org.objects.dt__config.updateOne({_id: config._id}, {$set: {dt__status: 'COMPLETED'}}).skipAcl().grant(6).execute()
                }
            } else {
                org.objects.dt__execution.updateOne({_id: executionId}, {
                    $set: {
                        dt__status: 'ERROR',
                        dt__error: err,
                        dt__ended: new Date()
                    }
                }).skipAcl().grant(8).execute()
                if(!config.dt__schedule.dt__active) {
                    // mark as completed
                    org.objects.dt__config.updateOne({_id: config._id}, {$set: {dt__status: 'ERROR'}}).skipAcl().grant(6).execute()
                }
            }
            Package.sendNotification(executionId, status, err)
        } else {
            logger.debug(`No Error no Completed on execution: ${execution._id}, ${JSON.stringify(rendererData)}`)
        }
        return {}
    }

    @route('GET /data-transfers/study', {
        name: 'dt__getStudyAndTasks',
