                'dt__step_ids',
                'dt__task_ids',
                'dt__study_id',
                'dt__type',
                'dt__timezoneFrom',
                'dt__includeIndexing',
                'dt__active'
            ).toArray()
        return {dt__config, exports}

    }

    /**
     * Cancel scheduled transfer
     * @memberOf Package
     * @path {PUT} /data-transfers/:id/cancel
     * @params {String} :id DTExecution _id
     * @example
     * curl -X PUT 'https://api-int-dev.medable.com/data-transfers/v2/routes/data-transfers/6081b3ae4a9b830100166d8f/cancel'
     */
    @route('PUT /data-transfers/:id/cancel', {
        name: 'dt__cancel_scheduled',
        acl: 'role.dt__admin',
        authValidation: 'all'
    })
    static cancelScheduled({req}) {
        const [config] = org.objects.dt__config.find({'_id': req.params.id})
        if (!config) {
            faults.throw('dt.notFound.noDataTransferConfigFound')
        }
        try {
            if (config.dt__schedule.dt__active) {
                logger.debug(`About to delete all previous events for: ${config.dt__key}`)
                org.objects.events.deleteMany({key: new RegExp(`^dt__${config.dt__key}`)}).skipAcl().grant(8).execute()
            }
            org.objects.dt__config.updateOne({_id: config._id}, {$set: {dt__status: 'CANCELLED'}}).skipAcl().grant(6).execute()
            const [execution] = org.objects.dt__execution.find({
                dt__status: 'RUNNING',
                dt__config: config._id
            }).sort({created: -1}).limit(1)
            if (execution) {
                try {
                    Package.cancelExecution(execution._id)
                } catch (ex) {
                    void ex
                }
            }
        } catch (ex) {
            logger.error(ex)
            faults.throw('dt.error.errorCancelling')
        }
    }

    /**
     * Return the list of executions for a given config
     * @memberOf Package
     * @path {GET} /data-transfers/:id/executions
     * @params {String} :id DTConfig _id
     * @response {Array} data list of exections
     * @example
     * curl 'https://api-int-dev.medable.com/data-transfers/v2/routes/data-transfers/6081b3ae4a9b830100166d84/executions'
     */
    @route('GET /data-transfers/:id/executions', {
        name: 'dt__exections_list',
        acl: 'role.dt__admin',
        authValidation: 'all'
    })
    static getAllExecutions({req}) {
        return expressions.pipeline.run([
            {
                $cursor: {
                    operation: "cursor",
