                    skipAcl: true,
                    grant: 4,
                    where: {
                        'dt__config': req.params.id
                    },
                    sort: { _id: -1 }
                }
            }, {
                $transform: {
                    vars: {
                        config: null,
                        creator: null,
                        updater: null,
                        configuredBy: null
                    },
                    each: {
                        set: {
                            config: {
                                $dbNext: [{
                                    $object: {
                                        object: "dt__config",
                                        where: {
                                            _id: "$$ROOT.dt__config._id"
                                        }
                                    }
                                }, 60]
                            },
                            creator: {
                                $dbNext: [{
                                    $object: {
                                        object: "account",
                                        skipAcl: true,
                                        grant: 4,
                                        where: {
                                            _id: "$$config.creator._id"
                                        },
                                        paths: {$literal: ['name']}
                                    }
                                }, 60]
                            },
                            updater: {
                                $dbNext: [{
                                    $object: {
                                        object: "account",
                                        skipAcl: true,
                                        grant: 4,
                                        where: {
                                            _id: "$$config.updater._id"
                                        },
                                        paths: {$literal: ['name']}
                                    }
                                }, 60]
                            },
                            configuredBy: {
                                $dbNext: [{
                                    $object: {
                                        object: "account",
                                        where: {
                                            _id: "$$ROOT.dt__configured_by._id"
                                        },
                                        paths: {$literal: ['name']}
                                    }
                                }, 60]
                            }
                        },
                        in: {
                            $mergeObjects: ['$$ROOT', {
                                $object: {
                                    dt__config: '$$config',
                                    dt__configuredBy: {
                                       $ifNull: ['$$configuredBy', { $ifNull: ['$$updater', '$$creator'] }]
                                    }
                                }
                            }]
                        }
                    }
                }
            }, {
                $project: {
                    'dt__started': '$$ROOT.dt__started',
                    'dt__ended':  '$$ROOT.dt__ended',
                    'dt__target_used': { $ifNull: ['$$ROOT.dt__target_used', 'SFTP'] },
                    'dt__path': { $ifNull: ['$$ROOT.dt__path', '$$ROOT.dt__config.dt__sftp_target.dt__path'] },
                    'dt__configured_by': '$$ROOT.dt__configuredBy',
                    'dt__configured_on': { $ifNull: ['$$ROOT.dt__configured_on', '$$ROOT.dt__config.updated'] },
                    'copy_url': '$$ROOT.dt__copy.url',
                    'dt__status': '$$ROOT.dt__status'
                }
            }
        ])
    }

    /**
     * Route to return all data transfers config.
     * @memberOf Package
     * @path {GET} /data-transfers
     * @response {Array} data list of data transfers.
     * @example
     * curl 'https://api-int-dev.medable.com/data-transfers/v2/routes/data-transfers'
     */
    @route('GET /data-transfers', {
        name: 'dt__config_return_all',
        acl: 'role.dt__admin',
        authValidation: 'all'
    })
    static getAllConfigs({req}) {
        const lastId = req.query.lastId || 0,
              perPage = req.query.perPage || 50,
              dateFormat = 'DD MMM YYYY HH:mm '
        const expPipeline = [
            {
                $cursor: {
                    'object': 'dt__config',
                    'operation': 'cursor',
                    where: {
                        '_id': {$gt: lastId}
                    },
                    paths: [
                        'dt__id',
                        'creator',
                        'updater',
                        'updated',
                        'created',
                        'dt__status',
                        'dt__schedule',
                        'dt__name',
                        'dt__bundle_name'
                    ],
                    sort: { created: -1 },
                    limit: perPage

                }
            }, {
                $transform: {
                    vars: {
                        creatorAccount: null,
                        updatedBy: null,
                        numExecutions: null,
                        lastTransfer: null,
                        lastSucceedTransfer: null,
                        nextTransfer: null
                    },
                    each: {
                        set: {
                            numExecutions: {
                                $dbNext: [
                                    {
                                        $object: {
                                            'object': 'dt__execution',
                                            'pipeline': {
                                                $array: [
                                                    {
                                                        $object: {
                                                            '$match': {
                                                                'dt__config._id': '$$ROOT._id',
                                                                'dt__status': 'SUCCESS'
                                                            }
                                                        }
                                                    },
                                                    {
                                                        $literal: {
                                                            '$group': {
                                                                '_id': null,
                                                                'total': {
                                                                    '$sum': 1
                                                                }
                                                            }
                                                        }
                                                    },
                                                    {
                                                        $literal: {
                                                            '$project': {
                                                                'total': 1
                                                            }
                                                        }
                                                    }
                                                ]
                                            }
                                        }
                                    },
                                    60
                                ]
                            },
                            creatorAccount: {
                                $dbNext: [
                                    {
                                        $object: {
                                            object: 'account',
                                            skipAcl: true,
                                            grant: 'read',
                                            where: {_id: '$$ROOT.creator._id'},
                                            paths: {$literal: ['name']}
                                        }
                                    },
                                    60
                                ]
                            },
                            updatedBy: {
                                $dbNext: [
                                    {
                                        $object: {
                                            object: 'account',
                                            skipAcl: true,
                                            grant: 'read',
                                            where: {_id: '$$ROOT.updater._id'},
                                            paths: {$literal: ['name']}
                                        }
                                    },
                                    60
                                ]
                            },
                            lastSucceedTransfer: {
                                $dbNext: [{
                                    $object: {
                                        "object": "dt__execution",
                                        "pipeline": {
                                            $array: [
                                                {
                                                    $object: {
                                                        "$match": {
                                                            "dt__config._id": "$$ROOT._id",
                                                            "dt__status": "SUCCESS"
                                                        }
                                                    }
                                                },
                                                {
                                                    $literal: {
                                                        "$sort": {
                                                            "created": -1
                                                        }
                                                    }
                                                },
                                                {
                                                    $literal: {
                                                        "$limit": 1
                                                    }
                                                }
                                            ]
                                        }
                                    }
                                }, 60]
                            },
                            lastTransfer: {
                                $dbNext: [{
                                    $object: {
                                        "object": "dt__execution",
                                        "pipeline": {
                                            $array: [
                                                {
                                                    $literal: {
                                                        "$sort": {
                                                            "created": -1
                                                        }
                                                    }
                                                },
                                                {
                                                    $object: {
                                                        "$match": {
                                                            "dt__config._id": "$$ROOT._id",
                                                            "created": {$object: {'$gte': {$ifNull: ["$$ROOT.updated", "$$ROOT.created"]}}}
                                                        }
                                                    }
                                                },
                                                {
                                                    $literal: {
                                                        "$limit": 1
                                                    }
                                                }
                                            ]
                                        }
                                    }
                                }, 60]
                            },
                            nextTransfer: {
                                $cond: [
                                    {
                                        $and: [
                                            { $in: [ '$$ROOT.dt__status', { $array: [ 'SCHEDULED_TRANSFER', 'RUNNING', 'READY_TO_TRANSFER' ] } ] },
                                            { $eq: ['$$ROOT.dt__schedule.dt__active', true] }
                                        ]
                                    },
                                    {
                                        $cond: [
                                            '$$lastTransfer',
                                            {
                                                $moment: [
                                                    '$$lastTransfer.dt__started',
                                                    {tz: {$ifNull: ['$$ROOT.dt__schedule.dt__start_timezone', 'UTC']}},
                                                    {
                                                        add: [
                                                            {$ifNull:['$$ROOT.dt__schedule.dt__repeat_value', 0]},
                                                            { $ifNull: ['$$ROOT.dt__schedule.dt__increment', 'hours']}
                                                        ]
                                                    },
                                                    {
                                                        format: `${dateFormat} z`
                                                    }
                                                ]
                                            },
                                            {
                                                $concat: [
                                                    {
                                                        $moment: [
                                                            '$$ROOT.dt__schedule.dt__start_date',
                                                            {
                                                                format: dateFormat
                                                            }
                                                        ]
                                                    },
                                                    {
                                                        $ifNull: [{
                                                            $moment: [
                                                                '$$ROOT.dt__schedule.dt__start_date',
                                                                {
                                                                    tz: {
                                                                        $ifNull: ['$$ROOT.dt__schedule.dt__start_timezone', 'UTC']
                                                                    }
                                                                },
                                                                {
                                                                    format: 'z'
                                                                }
                                                            ]
                                                        }, 'UTC']
                                                    }
                                                ]
                                            }
                                        ]
                                    },
                                    null
                                ]
                            }
                        },
                        in: {
                            $mergeObjects: ['$$ROOT', {
                                $object: {
                                    creator: '$$creatorAccount',
                                    updater: '$$updatedBy',
                                    executions: {$ifNull: ['$$numExecutions.total', 0]},
                                    lastTransfer:{
                                        $cond: ['$$lastSucceedTransfer.dt__started', {
                                            $moment: [
                                                '$$lastSucceedTransfer.dt__started',
                                                {
                                                    tz: {$ifNull: ['$$ROOT.dt__schedule.dt__start_timezone', 'UTC']}
                                                },
                                                {
                                                    format: `${dateFormat} z`
                                                }
                                            ]
                                        }, null]
                                    },
                                    nextTransfer: '$$nextTransfer'
                                }
                            }]
                        }
                    }
                }
            }, {
                $project: {
                    _id: '$$ROOT._id',
                    dt__key: '$$ROOT.dt__id',
                    creator: '$$ROOT.creator',
                    updater: '$$ROOT.updater',
                    executions: '$$ROOT.executions',
                    lastTransfer: '$$ROOT.lastTransfer',
                    nextTransfer: '$$ROOT.nextTransfer',
                    dt__status: '$$ROOT.dt__status',
                    dt__name: '$$ROOT.dt__name',
                    dt__bundle_name: '$$ROOT.dt__bundle_name'
                }
            }
        ]
        return expressions.pipeline.run(expPipeline)
    }

    /* UTILS */

    /**
     * Parse a Renderer result
     * @memberOf Package
     * @param {Object} result Renderer result json cleaned up
     * @returns {Object}
     */
    static parseRendererResult(result) {
        const keys = Object.keys(result)
        return result[keys[0]]
    }

    static cancelExecution(id) {
        const [execution] = org.objects.dt__execution.find({'_id': id})
        if (!execution) {
            faults.throw('dt.notFound.noExecutionFound')
        }
        try {
            const renderer = new Job(AXON_APP)
            if (execution.dt__status !== 'RUNNING' || !execution.dt__renderer_key) {
                faults.throw('dt.error.errorCancellingWrongState')
            }
            const {status} = Package.parseRendererResult(renderer.status(execution.dt__renderer_key))
            if (status !== 'Completed' && status !== 'Error') {
                renderer.cancel(execution.dt__renderer_key)
                org.objects.dt__execution.updateOne({'_id': execution._id}, {
                    $set: {
                        dt__status: 'CANCELLED',
                        dt__ended: new Date()
                    }
                }).skipAcl().grant(6).execute()
            } else {
                faults.throw('dt.error.errorCancellingWrongState')
            }
        } catch (ex) {
            logger.error(ex)
            faults.throw('dt.error.errorCancelling')
        }
    }


    /* EVENTS */

    /**
     * Event to execute a data transfer configuration.
     * @memberOf Package
     * @param {Object} params Parameters store in an event configuration { dt__key }
     */
    @on('dt__event_executioner')
    @as('dt__service', { principal: { skipAcl: true, grant: 'read' }, safe: false })
    static intermediateEvent(params) {
        logger.debug(`About to schedule event for ${JSON.stringify(params)}`)
        const {dt__key} = params
        if (dt__key) {
            const [config] = org.objects.dt__config.find({dt__key}).skipAcl().grant(4)

            if (!config) {
                logger.error('there is no config with that key:' + JSON.stringify(params))
            } else {
                const {
                        dt__start_timezone, dt__end_date, dt__end_timezone,
                        dt__repeat_value, dt__increment
                    } = config.dt__schedule,
                    expiresAt = dt__end_date ? moment.tz(moment(dt__end_date).format('YYYY-MM-DD HH:mm'), dt__end_timezone || dt__start_timezone).utc() : undefined,
                    // making schedule from now.
                    schedule = dt__repeat_value && dt__increment ? DTConfig.convertToCron(moment.utc(), dt__repeat_value, dt__increment) : undefined

                // schedule an event based on schedule information.
                logger.debug(`Creating schedule event for ${config.dt__key}`)
                const evt = DataTransferLib.fireEvent('dt__event_exp_execution', `dt__${config.dt__key}__${config.updated}`, {
                    dt__key: config.dt__key
                }, new Date(), expiresAt ? expiresAt.toDate() : undefined, schedule)
                if(!evt) {
                    logger.error(`Error creating event: ${JSON.stringify(config)}`)
                }
                logger.debug(evt)
            }
        } else {
            logger.error('There is no dt__key param on event: ' + JSON.stringify(params))
        }

    }

    /**
     * Event to execute a data transfer configuration.
     * @memberOf Package
     * @param {Object} params Parameters store in an event configuration { dt__key }
     */
    @on('dt__event_exp_execution')
    @as('dt__service', { principal: { skipAcl: true, grant: 'read' }, safe: false })
    static executeConfigEvent(params) {
        logger.debug(`running dt__event_exp_execution: ${JSON.stringify(params)}`)
        let renderer = new Job(AXON_APP)
        const {dt__key} = params
        if(dt__key) {
            const [config] = org.objects.dt__config.find({dt__key}).skipAcl().grant(4)
            if(!config) {
                logger.error('there is no config with that key:' + JSON.stringify(params) )
            } else {
                const exports = org.objects.dt__export.find({dt__config: config._id, dt__active: true}).toArray(),
                    {
                        _id,
                        dt__sftp_target: sftpTarget,
                        dt__include_timestamp: includeTimestamp,
                        dt__bundle_name
                    } = config
                let execution

                if (exports.length > 0) {
                    try {
                        // Prepare exports output/template and cursor.
                        exports.forEach((exp, k) => {
                            const expressionData = exp.dt__expression || DTExport.generateExpression(exp),
                                  cursorName = exp.dt__cursorName || `cursor_${(exp.dt__filename || '').replace(/[\W_]+/g, '')}_${exp.dt__format}`,
                                  template = exp.dt__template || DTExport.generateTemplate(exp.dt__mapping, cursorName, exp.dt__format)

                            renderer = renderer.addCursor(cursorName, org.objects.account.find({_id: null}).expressionPipeline(expressionData))
                                .addTemplate(`tpl_${cursorName}_${k}`, template)
                                .addOutput(exp.dt__filename, exp.dt__format, [`tpl_${cursorName}_${k}`])
                                .addOutput(`${exp.dt__filename}_copy`, exp.dt__format, [`tpl_${cursorName}_${k}`])
                        })

                        // Prepare name for exports
                        const path = sftpTarget.dt__path && sftpTarget.dt__path[sftpTarget.dt__path.length - 1] === '/' ? sftpTarget.dt__path : `${sftpTarget.dt__path}/`,
                            names = exports.reduce((obj, item) => {
                                const {dt__filename: filename, dt__format: format} = item
                                obj[filename] = sftpTarget.dt__zipped ? '' : `${path}${filename}.${format}`
                                return obj
                            }, {})
                        logger.debug(`Target path: ${path}`)
                        let bundleName = `${path}${dt__bundle_name}`

                        if (includeTimestamp) {
                            bundleName = `${bundleName}_${moment().format('DDMMMMYYYY_HH_mm')}`
                        }
                        logger.debug(`Bundle: ${bundleName}`)

                        execution = org.objects.dt__execution.insertOne({
                            dt__config: _id,
                            dt__started: new Date(),
                            dt__copy: `${dt__bundle_name}_copy.zip`,
                            dt__target_used: `SFTP ${sftpTarget.dt__pem_file ? '(SSH PEM)' : ''}`.trim(),
                            dt__path: bundleName,
                            dt__configured_on: config.created,
                            dt__configured_by: config.updater ? config.updater._id : config.creator._id
                        }).skipAcl().grant(8).lean(false).execute()
                        // Add sftp target credentials and compress if they apply
                        const {jobId} = renderer.addSftpTarget(names, {
                            username: sftpTarget.dt__username,
                            password: sftpTarget.dt__password,
                            port: sftpTarget.dt__port || 22,
                            privateKey: sftpTarget.dt__pem_file,
                            host: sftpTarget.dt__host
                        }, sftpTarget.dt__zipped ? {
                            compress: {
                                filename: `${bundleName}.zip`,
                                outputs: Object.keys(names)
                            }
                        } : {})
                            // adding file target as copy
                            .addFileTarget(`dt__executions/${execution._id}/dt__copy`, {
                                facets: Object.keys(names).reduce((obj, item, k) => {
                                    obj[`content${k > 0 ? k : ''}`] = `${item}_copy`
                                    return obj
                                }, {})
                            }, {
                                compress: {
                                    facet: 'content',
                                    outputs: Object.keys(names).map((n) => `${n}_copy`)
                                }
                            })
                            // adding callback data
                            .addCallback('/routes/data-transfers/callback', {
                                // environment
                                endpoint: `https://${script.env.host}`,
                                env: script.org.code
                            }, {
                                type: 'token',
                                token: Package.getCallbackToken()
                                // credentials
                            }, {
                                json: true,
                                body: {
                                    executionId: execution._id,
                                    configId: _id
                                }
                            })
                            .start()
                        logger.debug(`Sending to renderer ${jobId}, ${JSON.stringify(config)}`)
                        // update execution with renderer id
                        org.objects.dt__execution.updateOne({_id: execution._id}, {$set: {dt__renderer_key: jobId}}).skipAcl().grant(8).execute()
                    } catch (ex) {
                        logger.error(ex.toJSON())
                        if (execution) {
                            org.objects.dt__execution.updateOne({_id: execution._id}, {
                                $set: {
                                    dt__target_used: `SFTP ${sftpTarget.dt__pem_file ? '(SSH PEM)' : ''}`.trim(),
                                    dt__path: sftpTarget.dt__path,
                                    dt__configured_on: config.created,
                                    dt__configured_by: config.updater ? config.updater._id : config.creator._id,
                                    dt__status: 'ERROR',
                                    dt__error: ex.toJSON(),
                                    dt__config: _id,
                                    dt__started: new Date(),
                                    dt__ended: new Date()
                                }
                            }).skipAcl().grant(6).execute()
                        } else {
                            // create an error execution
                            execution = org.objects.dt__execution.insertOne({
                                dt__target_used: `SFTP ${sftpTarget.dt__pem_file ? '(SSH PEM)' : ''}`.trim(),
                                dt__path: sftpTarget.dt__path,
                                dt__configured_on: config.created,
                                dt__configured_by: config.updater ? config.updater._id : config.creator._id,
                                dt__status: 'ERROR',
                                dt__error: ex.toJSON(),
                                dt__config: _id,
                                dt__started: new Date(),
                                dt__ended: new Date()
                            }).skipAcl().grant(8).execute()
                        }
                        Package.sendNotification(execution._id, 'Error', JSON.stringify(ex.toJSON()))
                    }
                } else {
                    // create an error execution no exports present. Corner case.
                    if (execution) {
                        org.objects.dt__execution.updateOne({_id: execution._id}, {
                            $set: {
                                dt__target_used: `SFTP ${sftpTarget.dt__pem_file ? '(SSH PEM)' : ''}`.trim(),
                                dt__path: sftpTarget.dt__path,
                                dt__configured_on: config.created,
                                dt__configured_by: config.updater ? config.updater._id : config.creator._id,
                                dt__status: 'ERROR',
                                dt__error: {error: 'There are no exports configured to do a transfer'},
                                dt__config: _id,
                                dt__started: new Date(),
                                dt__ended: new Date()
                            }
                        }).skipAcl().grant(6).execute()
                    } else {
                        execution = org.objects.dt__execution.insertOne({
                            dt__target_used: `SFTP ${sftpTarget.dt__pem_file ? '(SSH PEM)' : ''}`.trim(),
                            dt__path: sftpTarget.dt__path,
                            dt__configured_on: config.created,
                            dt__configured_by: config.updater ? config.updater._id : config.creator._id,
                            dt__status: 'ERROR',
                            dt__error: {error: 'There are no exports configured to do a transfer'},
                            dt__config: _id,
                            dt__started: new Date(),
                            dt__ended: new Date()
                        }).skipAcl().grant(8).execute()
                    }
                    Package.sendNotification(execution._id, 'Error', 'There are no exports configured to do a transfer')
                }
            }
        } else {
            logger.error('There is no dt__key param on event: ' + JSON.stringify(params) )
        }

    }

    static getCallbackToken() {
        return org.objects.accounts.createAuthToken(AXON_APP, script.principal, {
            scope: [
                'object.*.dt__config',
                'object.*.dt__execution',
                'object.read.account',
                'object.read.org',
                'object.create.notification',
                'script.execute.route'
            ],
            includeEmail: true,
            maxUses: 1,
            policy: [{
                method: 'POST',
                path: [
                    '/routes/data-transfers/callback'
                ]
            }]
        })
    }

    static sendNotification(executionId, status, details) {
        // Send the notification via email to the creator + notification emails.
        logger.debug(`send notification ${executionId}`)
        const [execution] = org.objects.dt__execution.find({_id: executionId}),
              [config] = org.objects.dt__config.find({_id: execution.dt__config._id}),
              [creator] = org.objects.account.find({_id: config.creator._id}).paths('email').skipAcl().grant(4),
              emails = config.dt__notification_emails || [],
              sendTo = uniq([creator.email, ...emails])
        for(const recipient of sendTo) {
            notifications.send('dt__execution_status', {
                completed: status === 'Completed',
                details: JSON.stringify(details),
                id: executionId,
                name: config.dt__name || config._id
            }, {
                locale: 'en_US',
                recipient
            })
        }
    }

}

